} from 'reactstrap'
import {RecruiterCard} from './componentIndex';


class Team extends React.Component{

    constructor(props) {
        super(props);
        this.state = {recruiters: []};
    }

    componentDidMount() {
        this.fetch_recruiters();
    }

    fetch_recruiters() {
        fetch(`http://192.168.56.101:1337/recruiters`)
            .then( ({results}) => this.setState({recruiters: results}));
      }

    render() {

        const fetch_recruiters = async (event) => {
            //event.preventDefault();

            const resp = await axios.get();
            console.log(resp.data);
            set_data(resp.data);
          //
        }

        function set_data(data){
            console.log(data);
            resp_data = data;
        }

        console.log(resp_data)

        return(
            <div id= 'recruiting-team' onLoad={fetch_recruiters}>
                {/* <Container> */}
                {resp_data.map(profile => <RecruiterCard key={profile.id} {...profile} />)}
                {/* </Container> */}

            </div>
        );
    }

}

export default Team;
